const TabPanel = (props) => {
    const { children, value, index, ...other } = props;

    return (
      <div
        role="tabpanel"
        hidden={value !== index}
        {...other}
      >
        {value === index && (
          <div style={{paddingTop: 30, paddingLeft : 20, backgroundColor: '#ffffff'}} >
            {children}
          </div>
        )}
      </div>
    );
  }
  export default TabPanel;
